import Business from "./Components/Pages/Business";
import BostonBusiness from "./Components/Pages/BostonBusiness";


function App() {
    return (
      <HashRouter>
      <div className="App">
          <br />
          <Routes>
            <Route path='/' component={Homepage} />
            <Route path='/business' element={BostonBusiness} />
          </Routes>
      </div>
      </HashRouter>
    );
